import React from 'react'
import {Link} from 'react-router-dom'

export default function NavBar() {
  return (
    <div className="flex w-full h-24 justify-end items-center">
      <Link className="mx-4 text-xl text-black hover:underline no-underline font-bold" to="/">Home</Link>
      <Link className="mx-4 text-xl text-black hover:underline no-underline font-bold" to="/projects">Projects</Link>
      <a className="mx-4 text-xl text-black hover:underline no-underline font-bold" href="/#articles">Articles</a>
      <a href="contact" className="mx-4 text-xl text-black hover:underline no-underline font-bold" href="/#contact">Contact</a>
    </div>
  )
}
